import React from "react";
import {Link} from "react-router-dom";

class Navbar extends React.Component{
  render() {
    return(
      <div>
        <nav>
          <a href="#" data-target="slide-out" className="sidenav-trigger show-on-medium-and-down"><i
            className="fas fa-bars"></i></a>
          <ul className="right">
            <li><Link to={`/`}><b>HOME</b></Link></li>
            <li><Link to={`/all-seasons`}><b>ALL SEASONS</b></Link></li>
            <li><Link to={`/all-stats`}><b>ALL STATS</b></Link></li>
          </ul>
        </nav>

        <ul id="slide-out" className="sidenav">
          <li>
            <div className="user-view">
              <div className="background">
                <img src="img/ipl-small-banner-dimmed.png" />
              </div>
            </div>
          </li>
        </ul>

      </div>
    )
  }
}
export  default Navbar;
